import React, { Component } from 'react';

class Projects extends Component {
    constructor(props){
        super(props);
        this.state = {activeTab: 0};
    }
    render() {
      return(
          <div className="category-tabs"> 

          <Tabs activeTab={this.state.activeTab} onChange={(tabId) => this.setState({activeTba: tabId})}>
          <Tab> React</Tab>
          <Tab> Angular</Tab>
          <Tab> VueJS</Tab>
          <Tab> MongoDB</Tab>

          </Tabs>

          </div>
      )
    }
}

export default Projects;
